/*
** @param str: a C-string containing only lowercase letters and spaces (' ')
** @return: a C-string allocated on the heap containing the highest scoring word of str
*/
char  *highestScoringWord(const char *str)
{
    // printf("len %i\n",strlen(str) );
    int currentScore = 0;
    int highScore = 0;
    char highestWord[1000];
    int k = 0;
    char tempCurrent[1000];
    for (size_t i = 0; i < strlen(str); i++) {
        // puts("loop");
        // printf("i: %i\n", i);
        if(str[i] != ' '){
            // printf("str i%c\n", str[i]);
            int convert = str[i] - 97 + 1;
            currentScore += convert;
            tempCurrent[k] = str[i];
            printf("temp %c\n", tempCurrent[k]);
            printf("k: %i\n", k);
            printf("highScore: %i\n", highScore);
            printf("currentScore: %i\n", currentScore);
            k++;
        }
        if(str[i] == ' '  || i == (strlen(str)-1)) {
            printf("\n");
            if(currentScore > highScore){
                puts("SPACE");
                printf("HIGH %i\n", strlen(highestWord) );
                printf("HIGH %s\n", highestWord );
                printf("TEMP %i\n", strlen(tempCurrent) );
                printf("TEMP %s\n", tempCurrent );
                // reset mem on highest word
                memset(highestWord, 0, sizeof(strlen(highestWord)));
                strcpy(highestWord, tempCurrent);
                // set high score to current
                highScore = currentScore;
                // reset current score
            }
            memset(tempCurrent, 0, sizeof(strlen(tempCurrent)));
            currentScore = 0;
            k = 0;
            printf("high word %s\n", highestWord);
        }

    }
    char *mem = malloc(strlen(highestWord)+1);
    for (size_t i = 0; i < strlen(highestWord); i++) {
        mem[i] = highestWord[i];
        // printf("%c\n",mem[i] );
    }
    mem[strlen(highestWord)] = '\0';
    printf("high bottom return %s\n",mem );
    return mem;
}

